/**
 * Created by Lenovo on 2019/8/7.
 */
import React from 'react';
import './index.css';
import titleLeft from '../image/select/title-left.png';
export default class Title extends React.Component {
    constructor(props) {
        super(props);
    }
    render() {
        const {title,onLeftClick,isHome} =this.props;
        if(isHome){
            return (
                <div>
                    <div className="title-home"><span>{title}</span></div>
                </div>
            )
        }else {
            return (
                <div className="title-bg">
                    <div className="title">
                        <img src={titleLeft} alt="" className="title-img" onClick={()=>onLeftClick()}/>
                        <span>{title}</span>
                        <div className="title-img"></div>
                    </div>
                    <div className="title-solid"></div>
                </div>
            )
        }
    }
}
